import React from 'react';

function NameGenerator({ selectedGender, selectedRace, selectedCulture }) {
  // Generate names based on selectedGender, selectedRace, and selectedCulture
  return (
    <div>
      <h2>Generated Names:</h2>
      <p>Selected Gender: {selectedGender}</p>
      <p>Selected Race: {selectedRace}</p>
      <p>Selected Culture: {selectedCulture}</p>
      {/* Display generated names here */}
    </div>
  );
}

export default NameGenerator;
